import React from 'react'

const Header = () => {
    return(
    <div className='bg-gray-200 p-4 shadow-lg'>
      <div className='container mx-auto'>
         <img src='/mecontalogo.png' alt='MeConta'/>
       </div>
     </div>
    )
}
export default Header
